import "./app.scss"
import { Entry } from "./component/entry";



 const App = ()=>{
    return(
        <div className="App-container">
        <BrowserRouter>
        <Routes>
          <Route path="/entry" element = {<Entry/>}>

          </Route>
        </Routes>
        </BrowserRouter>
        </div>
    )
 }
 export default App;
